import React, { Component } from 'react';

import './App.css';

class App extends Component {

  constructor(){
    super();
      this.state = {
        title: '',
        searchField: '',
        ascr1: ''
      };
    }

  render(){
    return (
      <div className="App">
      <h1>Books List</h1>
      </div>
    );
  }
}
export default App;
